import PostList from './pages/postList';
import Header from './components/header';
import Footer from './components/footer';
import {BrowserRouter as Router, Route, Routes} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Router>
        <Header/>
        <Routes>
          <Route path='/' element={<PostList/>}/>
        </Routes>
        <Footer/>
      </Router>
    </div>
  );
}

export default App;
